import React from 'react';
import '../../App.css';
import Avatar from '@material-ui/core/Avatar';

export default function About() {
  return (
    <div className="contenair">
      <div className="avatar">
      <Avatar size="2"alt="Remy Sharp" src="../images/img-2.jpg" />
      <Avatar alt="Travis Howard" src="../images/img-3.jpg"  />
      <Avatar alt="Cindy Baker" src="../images/img-4.jpg"  />
    </div>
    </div>
  );
}
